
Muestre su utopía de la isla a familiares y amigos, o empacar sus maletas y visite las suyas. Ya sea jugar en línea o con otros a su lado, la vida en la isla es aún mejor cuando se puede compartirlo. Incluso sin saltar en un vuelo, conocerás a un elenco de encantadores residentes de animales repletos de personalidad. Caras amigables como Tom Nook e Isabelle prestarán sus servicios y felizmente le ayudarán a hacer crecer su comunidad en ciernes. Escápate a tu escapada en la isla, sin embargo, cuando quieras y donde quieras. ',2,2),
	 ('Back 4 Blood','1639948834759.jpg','2021-12-19 21:20:34',NULL,NULL,5735,'Back 4 Blood es un emocionante tirador cooperativo en primera persona de los creadores de la aclamada franquicia dejada 4 muertos. Estás en el centro de una guerra contra los montados. Estos anfitriones de un parásito mortal se han convertido en criaturas aterradoras dobladas en devorar lo que queda de la civilización. Con la extinción de la humanidad en la línea, depende de ti y de tus amigos llevar la lucha al enemigo, erradicar a los montados y recuperar el mundo.',2,3),
	 ('Battlefield 2042','1639948874522.jpg','2021-12-19 21:21:14',NULL,NULL,8795,'Battlefield 2042 es un tirador en primera persona que marca el regreso a la icónica guerra completa de la franquicia. En un mundo casi futuro transformado por el trastorno se adapta y supera los campos de batalla que cambian dinámicamente con la ayuda de tu escuadrón y un arsenal de vanguardia. Con soporte para 128 jugadores en PlayStation 5, Battlefield 2042 trae una escala sin precedentes en grandes terrenos de batalla en todo el mundo. Los jugadores asumirán varias experiencias masivas, desde modos multijugador actualizados como Conquest y Breakthrough hasta la nueva zona de peligro. *Condiciones y restricciones. Ningún fabricante de armas, vehículos o engranajes está afiliado o ha respaldado este juego.',2,1);

Juega en casa en el televisor o en el camino con el sistema Nintendo Switch modelo OLED y su vibrante pantalla OLED de 7 pulgadas. Además de una nueva pantalla con colores vivos y contraste nítido, el modelo OLED Nintendo Switch incluye un amplio soporte ajustable para ángulos de visión más cómodos, un dock con un puerto LAN con cable para modo TV (cable LAN se vende por separado), 64 GB de almacenamiento interno y audio mejorado en modos de mano y mesa utilizando los altavoces del sistema.',1,2),
	 ('Xbox Series X','1639949354560.jpg','2021-12-19 21:29:14','2021-12-19 21:30:22',NULL,213999,'Presentamos Xbox Series X, la Xbox más rápida y potente que nunca. Juega miles de títulos de cuatro generaciones de consolas: todos los juegos se ven y juegan mejor en Xbox Series X. En el corazón de la Serie X se encuentra la arquitectura Xbox Velocity, que combina una SSD personalizada con software integrado para un juego más rápido y optimizado con tiempos de carga significativamente reducidos. Muévete sin problemas entre varios juegos en un destello con un resumen rápido. Explora nuevos mundos ricos y disfruta de la acción como nunca antes con los inigualables 12 Teraflops de potencia de procesamiento gráfico crudo. Disfruta de juegos en 4K con hasta 120 fotogramas por segundo, sonido espacial 3D avanzado y mucho más. Empieza con una biblioteca instantánea de más de 100 juegos de alta calidad, incluidos todos los nuevos títulos de Xbox Game Studios el día en que se lanzan como Halo Infinite, con Xbox Game Pass Ultimate (la membresía se vende por separado).',1,1),
	 ('Gamepad Sony DualSense Midnight Black','1639949798989.jpg','2021-12-19 21:36:38',NULL,NULL,12999,'Enciende tus noches de juego en tu consola PS5 con el mando inalámbrico DualSense Midnight Black. Parte de una nueva gama de colores temáticos de galaxia, este elegante diseño se inspira en cómo vemos las maravillas del espacio a través del cielo nocturno, con tonos sutiles de detalles en negro y gris claro. Descubre una experiencia de juego más profunda y altamente envolvente** que da vida a la acción en las palmas de tus manos. El controlador inalámbrico DualSense ofrece una respuesta táctil envolvente*, disparadores adaptativos dinámicos* y un micrófono integrado, todo integrado en un cómodo diseño icónico. (*Disponible cuando la función es compatible con el juego. **Comparado con el controlador inalámbrico DUALSHOCK 4. †Se necesita Internet y cuenta para PlayStation Network.)',3,1),
	 ('Gamepad Sony DualSense White','1639949849450.jpg','2021-12-19 21:37:29',NULL,NULL,11999,'Enciende tus noches de juego en tu consola PS5 con el mando inalámbrico DualSense Midnight Black. Parte de una nueva gama de colores temáticos de galaxia, este elegante diseño se inspira en cómo vemos las maravillas del espacio a través del cielo nocturno, con tonos sutiles de detalles en negro y gris claro. Descubre una experiencia de juego más profunda y altamente envolvente** que da vida a la acción en las palmas de tus manos. El controlador inalámbrico DualSense ofrece una respuesta táctil envolvente*, disparadores adaptativos dinámicos* y un micrófono integrado, todo integrado en un cómodo diseño icónico. (*Disponible cuando la función es compatible con el juego. **Comparado con el controlador inalámbrico DUALSHOCK 4. †Se necesita Internet y cuenta para PlayStation Network.)',3,1),
	 ('Xbox Core Controller Robot White','1639949917713.jpg','2021-12-19 21:38:37',NULL,NULL,12999,'Experimenta el diseño modernizado del control inalámbrico Xbox en color blanco robot, con superficies moldeadas y una geometría refinada para mayor comodidad durante el juego, con un rendimiento de la batería de hasta 40 horas. No pierdas de vista el objetivo con la almohadilla híbrida D, el agarre texturizado de los gatillos y la carcasa trasera. Captura y comparte contenido sin problemas como capturas de pantalla, grabaciones y mucho más con el botón compartir. Conectar a través del puerto USB-C y enchufar directamente a la consola o PC. Se incluye soporte para pilas AA en la parte trasera. Conecta cualquier auricular compatible con el enchufe de audio de 3.5 milímetros. Utiliza la aplicación de accesorios de Xbox para asignar botones y crear perfiles de control personalizados para tus juegos favoritos. Forme pareja rápidamente, juegue y cambie de dispositivos como Xbox Series X|S, Xbox One, PC Windows 10 y Android. Apoyo iOS en el futuro.',3,3);

