INSERT INTO stationgame.products (name,image,creation_date,modified_date,deletion_date,price,description,category_id,brand_id) VALUES
	 ('Madden NFL 22','1639948377757.jpg','2021-12-19 21:12:57',NULL,NULL,9789,'Madden NFL 22 es donde se juega el partido. Es todo lo que amas de la NFL inyectado en cada modo mediante el nuevo día del partido dinámico. Traído a la vida por la IA de estrellas con estadísticas de nueva generación (Next Gen Stats Star-Driven AI) y elementos de atmósfera del día de juego (Gameday Atmosphere), el día de juego dinámico (Dynamic Gameday) ofrece la experiencia de juego más inteligente hasta el momento, todo impulsado con datos de la vida real. Dynamic Gameday, Next Gen Stats Star-Driven AI y Gameday Atmosphere son exclusivos de las versiones PlayStation 5 y Xbox Series X|S de Madden NFL 22. **Oferta promocional de preventa de Madden NFL 22 - Esta oferta promocional de preventa caduca el 20 de agosto de 2021. Canjea la oferta antes del 1 de septiembre de 2022 para recibir 20 puntos de personal para el modo Franchise clásico, conectado para un jugador ("Puntos de personal"), 1 cápsula Vanity de atleta de portada, 1 artículo de un jugador estrella de la NFL Elite y el desbloqueo de 10 niveles en la clase de jugador "General" para el avatar del jugador en Face of the Franchise y The Yard.',2,1),
	 ('Ghost of Tsushima','1639948441833.jpg','2021-12-19 21:14:01',NULL,NULL,11989,'A finales del siglo XII, el Imperio Mongol ha puesto residuos a todas las naciones a lo largo de su campaña para conquistar el Oriente. La isla Tsushima es todo lo que se encuentra entre Japón continental y una enorme flota de invasión mongol dirigida por el general despiadado y astutuoso, Khotun Khan. A medida que la isla se quema en la caminata de la primera ola del asalto Mongol, el valiente guerrero samurái Jin Sakai se mantiene resuelto. Como uno de los últimos miembros supervivientes de su clan, Jin está decidido a hacer lo que necesite, a cualquier costo, para proteger a su pueblo y recuperar su hogar. Debe dejar de lado las tradiciones que lo han formado como guerrero para forjar un nuevo camino, el camino del fantasma, y salvar una guerra no convencional por la libertad de Tsushima. Ghost of Tsushima DIRECTOR''S CUT incluye: juego completo. - Expansión Iki Island: nueva historia, mini-juegos, tipos enemigos y más. - Modo cooperativo en línea Legends. - Mini libro de arte digital de Dark Horse. - Comentario del director: el equipo creativo se asienta con un famoso historiador japonés para mirar el mundo de Ghost of Tsushima y cómo se compara con los eventos de la vida real que lo inspiró. - Un punto técnico. - Dije del recuerdo de Hachiman. - Juego de piel de héroe de Tsushima: máscara dorada, kit de espada, caballo, sillín.',2,1),
	 ('Jurassic World Evolution ','1639948502569.jpg','2021-12-19 21:15:02',NULL,NULL,7895,'Jurassic World Evolution 2 es la secuela tan esperada de la exitosa evolución Jurassic World Evolution, basándose en la innovadora e inmersiva simulación de gestión de 2018. Introduce una campaña atractiva, nueva y narrativa, nuevas características increíbles y nuevos dinosaurios sorprendentes que cobran vida con una autenticidad cautivadora. Junto con una construcción ampliada y más opciones de personalización, el resultado es un juego aún más grande, mejor y auténtico de Jurassic World.',2,3),
	 ('NASCAR HEAT Ultimate Edition+','1639948566643.jpg','2021-12-19 21:16:06',NULL,NULL,12789,'NASCAR Heat Ultimate Edition+, el videojuego oficial de la temporada 2020, la serie de carreras de stockcar más popular del mundo te pone al volante y te desafía a convertirte en el campeón de la serie NASCAR Cup Series. Cuenta con los equipos oficiales de 2020, pilotos, coches y horarios de las tres NASCAR National Series, así como el Xtreme Dirt Tour, compitiendo en 39 pistas auténticas. Ultimate Edition+ incluye todo en NASCAR Heat 5 Ultimate Edition, además de la NASCAR Cup Series Roster 2021 y esquemas de pintura primaria 2021. El contenido destacado incluye esquemas de pintura Throwback y Playoff 2020, Tony Stewart como personaje jugable, ¡y más!',2,2),
	 ('Halo Infinite','1639948615531.jpg','2021-12-19 21:16:55',NULL,NULL,6367,'Cuando toda la esperanza se pierde y el destino de la humanidad cuelga en el equilibrio, el jefe maestro está listo para enfrentarse al enemigo más despiadado que jamás haya enfrentado. La legendaria serie Halo regresa con la historia más amplia de Master Chief hasta el momento.',2,3),
	 ('Ratchet & Clank: Rift Apart','1639948660644.jpg','2021-12-19 21:17:40',NULL,NULL,12474,'Los aventureros intergalácticos han vuelto con un flequillo. Ayúdales a detener una intención robótica de conquistar mundos transdimensionales, con su propio universo junto en la línea de disparo. Voltea tu camino a casa con un arsenal de armas escandalosas. Experimenta el Shuffle de Rifts dimensional y el juego dinámico. Explora planetas nunca antes vistas y versiones de dimensiones alternativas de viejos favoritos. Características de PS5: siente acciones en el juego a través de la retroalimentación háptica del controlador inalámbrico de doble sentido. Toma el control total de la mecánica avanzada de armas, hecho posible mediante gatillos adaptativos. Planet-hop a hipervelocidad a través de la carga casi instantánea del SSD de la consola PS5. Sumerge tus oídos con Tempest 3D Audio Tech mientras trabajas para salvar el universo. La iluminación y el seguimiento de los rayos mejorados representan deslumbrantes mundos en el juego, mostrados en 4K y HDR nítidos, dinámicos. Elige el modo de rendimiento para disfrutar de 60 fotogramas por segundo de juego. (Con auriculares compatibles). Dynamic 4K y HDR requieren un televisor o pantalla compatible con 4K y HDR.',2,1),
	 ('Disney Classic Games Collection','1639948714943.jpg','2021-12-19 21:18:34',NULL,NULL,11254,'The Expanded Collection: Juega a través de múltiples versiones diferentes de los queridos juegos de Aladdin, The Lion King y The Jungle Book que se han creado a lo largo de los años, incluyendo tanto versiones de consola como de mano.',2,2),
	 ('Animal Crossing: New Horizons','1639948778749.jpg','2021-12-19 21:19:38',NULL,NULL,14583,'Escápate a una isla desierta y crea tu propio paraíso mientras exploras, creas y personalizas en el juego Animal Crossing: New Horizons. Su escapada a la isla tiene una gran cantidad de recursos naturales que se pueden utilizar para crear todo, desde herramientas hasta comodidades de criatura. Puede cazar insectos en la grieta del amanecer, decorar su paraíso durante todo el día, o disfrutar de la puesta de sol en la playa mientras pesca en el océano. La hora del día y la temporada coinciden con la vida real, por lo que cada día en su isla es una oportunidad para registrarse y encontrar nuevas sorpresas durante todo el año.
INSERT INTO stationgame.products (name,image,creation_date,modified_date,deletion_date,price,description,category_id,brand_id) VALUES
	 ('Kena: Bridge of Spirits','1639948910210.jpg','2021-12-19 21:21:50',NULL,NULL,12678,'Una aventura de acción basada en historias que combina la exploración con el combate acelerado. Mientras Kena, los jugadores encuentran y crecen un equipo de compañeros espirituales encantadores llamados Rot, mejorando sus habilidades y creando nuevas formas de manipular el medio ambiente. Kena, un joven guía espiritual, viaja a un pueblo abandonado en busca del sagrado santuario de montaña. Ella lucha por descubrir los secretos de esta comunidad olvidada escondida en un bosque cubierto donde los espíritus errantes están atrapados. Kena: Bridge of Spirits - Deluxe Edition incluye: juego base, banda sonora digital oficial, personal de Kena único, piel de putrefacción dorada, hoja de pegatinas exclusivas para minoristas, sombreros de celebración únicos para la putrefacción.',2,1),
	 ('Minecraft Dungeons Hero Edition','1639948951403.jpg','2021-12-19 21:22:31',NULL,NULL,7689,'Lucha a través de un nuevo juego de acción y aventura, inspirado en los clásicos orugas de calabozos y en el universo de Minecraft. ¡Viste a los calabozos solos o únete con amigos! Hasta cuatro jugadores pueden luchar juntos a través de niveles llenos de acción, llenos de tesoros y variados, todo en una búsqueda épica para salvar a los aldeanos y derrotar al malvado Arch-Illager. Descubre un montón de poderosas nuevas armas y artículos que te ayudarán a derrotar enjambres despiadados de turbas nuevas y desagradables. ¡Lucha o huye a través de cañones, pantanos y, por supuesto, las minas! Cualquier aventurero valiente o tonto suficiente para explorar este mundo bloqueado y hermoso tendrá que prepararse. ¡Tan rápidamente! Minecraft Dungeons Hero Edition incluye el contenido de Hero Pass DLC: una capa de héroe, dos pieles de jugadores y una mascota de pollo. También incluye los paquetes DLC de Jungle Awakens y Creeping Winters.',2,3),
	 ('Mortal Kombat 11 Ultimate','1639949001074.jpg','2021-12-19 21:23:21',NULL,NULL,11590,'Preordena y obtén el paquete de piel de los guerreros del tiempo con saibot de red oscura, HCF Liu Kang & blood Moon skarlet. La experiencia definitiva Mk11. Toma el control de los protectores de la tierra en las dos campañas de historias aclamadas del juego mientras corren para evitar que Kronika rebobinar el tiempo y reiniciar la historia. Las amistades se prueban, y se forjan nuevas alianzas en la batalla para salvar toda la existencia. Mk11 Ultimate cuenta con la lista completa de 37 personajes, incluyendo nuevas adiciones Rain Mileena & Rambo. Mortal Kombat 11 muestra cada divertida amistad, mortal mortal y golpe mortal como nunca antes. Estarás tan cerca de la lucha que puedes sentirlo. Incluye Mortal Kombat 11, Kombat Pack 1, expansión postmatemáticas y Kombat Pack 2. Mk11 Ultimate está habilitado para entrega inteligente e incluye actualizaciones gratuitas en la serie Xbox X: resolución dinámica 4K, imágenes mejoradas, tiempos de carga significativamente mejorados y compatibilidad Cross-Platform/CrossGen.',2,3),
	 ('PlayStation 5','1639949080925.jpg','2021-12-19 21:24:40',NULL,NULL,210999,'La consola PS5 desata nuevas posibilidades de juego que nunca esperabas. Experimenta una carga rápida con un SSD de alta velocidad, inmersión más profunda con soporte para retroalimentación táctil, disparadores adaptativos y audio 3D, y una nueva generación de increíbles juegos de PlayStation.',1,1),
	 ('Xbox Series S','1639949133465.jpg','2021-12-19 21:25:33',NULL,NULL,89999,'Obtén el paquete totalmente digital Xbox Series S – Fortnite & Rocket League con el Midnight Drive Pack, 1,000 V-Bucks, y 1,000 créditos de Rocket League. Con el paquete Midnight Drive para Fortnite, puedes personalizar tu avatar con el traje Dark Skully, Dark Skully Satchel Back Bling, Dark Splitter Pickaxe, y 1,000 V-Bucks para pasar en artículos favoritos en Fortnite Battle Royale y más. Para el contenido adicional de Rocket League, obtienes el destacado auto Masamune Purple Virtual Wave Boost, Purple Zefram Wheels y 1.000 Credits de Rocket League que se pueden utilizar para construir Blueprints, actualizar a Rocket Pass Premium, o comprar el contenido más deseado de la tienda de artículos de Rocket League. Y, como Fortnite y Rocket League son libres para jugar con Xbox, puedes jugar directamente con tus amigos.',1,3),
	 ('Nintendo Switch OLED','1639949238614.jpg','2021-12-19 21:27:18',NULL,NULL,124999,'Presentamos al miembro más reciente de la familia Nintendo Switch.
INSERT INTO stationgame.products (name,image,creation_date,modified_date,deletion_date,price,description,category_id,brand_id) VALUES
	 ('Xbox Core Controller Shock Blue ','1639949947951.jpg','2021-12-19 21:39:07',NULL,NULL,12999,'Experimenta el diseño modernizado del control inalámbrico Xbox en color blanco robot, con superficies moldeadas y una geometría refinada para mayor comodidad durante el juego, con un rendimiento de la batería de hasta 40 horas. No pierdas de vista el objetivo con la almohadilla híbrida D, el agarre texturizado de los gatillos y la carcasa trasera. Captura y comparte contenido sin problemas como capturas de pantalla, grabaciones y mucho más con el botón compartir. Conectar a través del puerto USB-C y enchufar directamente a la consola o PC. Se incluye soporte para pilas AA en la parte trasera. Conecta cualquier auricular compatible con el enchufe de audio de 3.5 milímetros. Utiliza la aplicación de accesorios de Xbox para asignar botones y crear perfiles de control personalizados para tus juegos favoritos. Forme pareja rápidamente, juegue y cambie de dispositivos como Xbox Series X|S, Xbox One, PC Windows 10 y Android. Apoyo iOS en el futuro.',3,3),
	 ('Switch Pro Controller','1639950079801.jpg','2021-12-19 21:41:19',NULL,NULL,14999,'Adquiere el nuevo control Nintendo Switch Pro para explorar nuevas alternativas de juegos en tu consola Nintendo Switch
